webpackJsonp([35407131220697],{402:function(a,e){a.exports={data:{markdownRemark:{html:'<p>【活動の幅を広げます！】 私たちは見えないところで、様々なことに挑戦しております。 新しい Web アプリや、スマホアプリの実験なども挑戦の一つですが、その幅を広げるためにサーバ容量 10GB では少々足りないことに気づきました。 そこで、danmaq 設立期当初から 11 年間、長らく懇意にしていた <a href="http://ck.jp.ap.valuecommerce.com/servlet/referral?sid=3208894&#x26;pid=884046201">SPPD レンタルサーバ</a>を離れ、<a href="http://px.a8.net/svt/ejp?a8mat=2NBUD6+FTRUPE+CO4+TVYKI">エックスサーバー</a>へと、移転することを決定いたしました。  【表示が二倍早くなる！？】 <a href="http://px.a8.net/svt/ejp?a8mat=2NBUD6+FTRUPE+CO4+TVYKI">エックスサーバー</a>では、今までの PHP5.3 よりも 2 倍以上高速な PHP7 を搭載しています。 また、従来の 20 倍もの空きスペースがあるため、活動の幅が大幅に広がります。 これらのスペックは、今後の danmaq 作品という形で、あなたへより大きな価値提供ができることをお約束します！  【あなたはそのまま待つだけです！】 danmaq はドメインごと引っ越します。つまり、新しいサーバでも URL は danmaq.com のままです。 ただし、移転作業のため今月下旬の間、断続的にページが表示されなくなることがあります。 ご不便をおかけいたしますが、少々の間お待ちください！ つきましてはご挨拶が遅れましたが、2016年も奮闘してまいりますので、今年もよろしくお願いします！</p>',frontmatter:{cover:null,date:"2016-01-16T01:44:41+09:00",strDate:"2016/1/15",title:"1月下旬、danmaq に大工事を施します！"},fields:{langKey:"ja",slug:"/ja/blog/2016/01/16-renew2016/"}}},pathContext:{path:"/ja/blog/2016/01/16-renew2016/",langKey:"ja"}}}});
